        combs = [[m] for m in min_rows[0]]
        for i, mins in enumerate(min_rows[1:]):
            new_combs = []
            for comb in combs:
                for j, v in mins:
                    if comb[-1][0] != j:
                        new_combs.append(comb + [(j, v)])
            combs = new_combs
        return min([sum([v for j, v in comm]) for comm in combs])


